# seeds the businesses, taggings, and tags tables
business_ids = []
businesses_search_array.each do |business|
  new_business = Business.new(
    user_id: 1,
    name: business[:name],
    street_address: business[:location][:address1],
    city: business[:location][:city],
    state: business[:location][:state],
    zip: business[:location][:zip_code],
    price: business[:price],
    image_url: business[:image_url],
    website_url: business[:url],
    lat: business[:coordinates][:latitude],
    long: business[:coordinates][:longitude]
  );

  if new_business.valid?
    new_business.save!
    business[:categories].each do |tag|
      new_tag = Tag.new(name: tag[:title])
      if new_tag.valid?
        new_tag.save!
        Tagging.create!(business_id: new_business.id, tag_id: new_tag.id)
      else
        existing_tag = Tag.find_by(name: tag[:title])
        Tagging.create!(business_id: new_business.id, tag_id: existing_tag.id)
      end
    end
  else
    next
  end
end

